import React from "react";
import { Event } from "../types";

interface EventMarkerProps {
  event: Event;
  isActive: boolean;
  onClick: () => void;
}

const EventMarker: React.FC<EventMarkerProps> = ({ event, isActive, onClick }) => {
  return (
    <div
      className={`dots ${isActive ? "active" : ""}`}
      onClick={onClick}
    >
      {event.year}
    </div>
  );
};

export default EventMarker;
